ITA:
Radiant Smart è il sistema di controllo remoto delle caldaie Radiant via WiFi.
Con Radiant Smart, anche se sei fuori casa, hai la gestione completa della caldaia, del tuo impianto di riscaldamento e ACS tramite smartphone e tablet con un interfaccia semplice e intuitiva.

Con Radiant Smart puoi:
- Impostare la modalità di funzionamento da te scelta;
- Visualizzare tutte le temperature e lo stato di funzionamento della tua caldaia in tempo reale;
- Visualizzare e regolare la temperatura ambiente di casa;
- Gestire l'accensione e lo spegnimento della caldaia, manualmente o tramite programma a fasce orarie;
- Ricevere una notifica nel caso di blocco della caldaia e, dove possibile, effettuare il reset a distanza;
- Visualizzare la cronologia degli ultimi errori segnalati dalla caldaia;
- Visualizzare e gestire la termoregolazione per limitare i consumi.

ENG:
Radiant Smart is the remote control system for Radiant boilers via WiFi.
Even if you are away from home, Radiant Smart allows you to manage the boiler, the heating and the DHW system via smartphone and tablet with a simple and intuitive interface.

Radiant Smart allows you to:
- Set the operating mode of your choice;
- View all temperatures and operating status of your boiler in real time;
- View and adjust the home room temperature;
- Manage boiler’s ignition and switch off, manually or via a time slot program;
- Receive a notification in case of boiler’s lock-out and, if possible, remotely reset it;
- View the boiler’s alarm history;
- View and manage the thermoregulation in order to limit consumption.
